def get_cooldown(user_id, command_type):
    cooldown_duration = global_cooldowns.get(command_type, 0)
    last_use = user_last_use.get((user_id, command_type), 0)
    current_time = time.time()
    remaining_cooldown = cooldown_duration - (current_time - last_use)
    return max(0, remaining_cooldown)

def check_cooldown(user_id, command_type):
    remaining_cooldown = get_cooldown(user_id, command_type)
    if remaining_cooldown <= 0:
        user_last_use[(user_id, command_type)] = time.time()
        return True
    return False

def safe_get(data, *keys, default=None):
    for key in keys:
        if isinstance(data, dict):
            data = data.get(key, default)
        elif isinstance(data, list) and isinstance(keys[0], int):
            data = data[keys[0]] if 0 <= keys[0] < len(data) else default
        else:
            return default
    return data

def get_item_details(item):
    name = safe_get(item, 'display_name', default='Unknown')
    enchantments = safe_get(item, 'tag', 'ExtraAttributes', 'enchantments', default={})
    return name, enchantments

def get_wardrobe_info(profile_data):
    wardrobe_info = []
    wardrobe_data = safe_get(profile_data, 'items', 'wardrobe', default=[])
    
    for armor_set in wardrobe_data:
        if isinstance(armor_set, list):
            set_info = []
            for piece in armor_set:
                name = safe_get(piece, 'display_name', default='Unknown')
                set_info.append(name)
            if set_info:
                wardrobe_info.append(set_info)
    
    return wardrobe_info

def format_number(number):
    if number >= 1_000_000_000:
        return f"{number / 1_000_000_000:.3f}b"
    elif number >= 1_000_000:
        return f"{number / 1_000_000:.3f}m"
    elif number >= 1_000:
        return f"{number / 1_000:.3f}k"
    else:
        return f"{number:.3f}"

def get_skyblock_info(ign):
    base_url = "https://sky.shiiyu.moe/api/v2/profile/"
    try:
        response = requests.get(f"{base_url}{ign}")
        response.raise_for_status()
        data = response.json()
        if 'error' in data:
            return f"Error: {data['error']}"
        
        profiles = data.get('profiles', {})
        selected_profile = next((profile for profile in profiles.values() if profile.get('current')), None)
        if not selected_profile:
            return {'Error': 'no current profile found'}
        
        profile_data = selected_profile.get('data', {})
        raw_data = selected_profile.get('raw', {})
        
        skyblock_level = safe_get(profile_data, 'skyblock_level', 'level', default=0)
        networth = safe_get(profile_data, 'networth', 'networth', default=0)
        skills = safe_get(profile_data, 'skills', 'skills', default={})
        skill_levels = {skill: details.get('level', 0) for skill, details in skills.items() if skill not in ['runecrafting', 'social']}
        slayers = safe_get(profile_data, 'slayer', 'slayers', default={})
        slayer_levels = {slayer: safe_get(details, 'level', 'currentLevel', default=0) for slayer, details in slayers.items()}
        
        weapons_section = safe_get(profile_data, 'items', 'weapons', 'weapons', default=[])
        top_weapons = [get_item_details(weapon) for weapon in weapons_section[:5]]
        
        farming_tools_section = safe_get(profile_data, 'items', 'farming_tools', 'tools', default=[])
        farming_tools = [get_item_details(tool) for tool in farming_tools_section]
        
        fishing_tools_section = safe_get(profile_data, 'items', 'fishing_tools', 'tools', default=[])
        fishing_tools = [get_item_details(tool) for tool in fishing_tools_section]
        
        mining_tools_section = safe_get(profile_data, 'items', 'mining_tools', 'tools', default=[])
        mining_tools = [get_item_details(tool) for tool in mining_tools_section]
        
        magical_power = safe_get(raw_data, 'accessory_bag_storage', 'highest_magical_power', default=0)
        
        wardrobe_info = get_wardrobe_info(profile_data)
        
        return {
            "Skyblock Level": skyblock_level,
            "Networth": format_number(networth),
            "Skill Levels": {skill: level for skill, level in skill_levels.items()},
            "Slayer Levels": {slayer: level for slayer, level in slayer_levels.items()},
            "Top 5 Weapons": top_weapons,
            "Farming Tools": farming_tools,
            "Fishing Rods": fishing_tools,
            "Mining Tools": mining_tools,
            "Magical Power": magical_power,
            "Wardrobe": wardrobe_info
        }
    
    except requests.exceptions.HTTPError as http_err:
        return {'Error': f'HTTP error occurred: {str(http_err)}'}
    except requests.exceptions.RequestException as req_err:
        return {'Error': f'Network error occurred: {str(req_err)}'}
    except json.JSONDecodeError as json_err:
        return {'Error': f'Error parsing response: {str(json_err)}'}
    except Exception as e:
        return {'Error': f'An unexpected error occurred: {str(e)}'}

def scrape_hypixel_wiki_page(page_name):
    url = f'https://wiki.hypixel.net/{page_name}'
    response = requests.get(url)
    
    if response.status_code == 200:
        soup = BeautifulSoup(response.text, 'html.parser')
        rendered_text = soup.get_text()
        return rendered_text
    else:
        return f'Error: Unable to access page. Status code: {response.status_code}'

auction_cache = {"data": None, "timestamp": 0}
CACHE_DURATION = 300

async def fetch_auction_page(session, page):
    url = f'https://api.hypixel.net/skyblock/auctions?page={page}'
    async with session.get(url) as response:
        return await response.json()

async def get_all_auctions():
    current_time = time.time()
    if auction_cache["data"] and current_time - auction_cache["timestamp"] < CACHE_DURATION:
        return auction_cache["data"]

    all_auctions = []
    async with aiohttp.ClientSession() as session:
        first_page = await fetch_auction_page(session, 0)
        if not first_page['success']:
            print(f"Error fetching auction data: {first_page.get('cause', 'Unknown error')}")
            return []

        all_auctions.extend(first_page['auctions'])
        total_pages = first_page['totalPages']

        tasks = [fetch_auction_page(session, page) for page in range(1, total_pages)]
        pages = await asyncio.gather(*tasks)

        for page in pages:
            if page['success']:
                all_auctions.extend(page['auctions'])

    auction_cache["data"] = all_auctions
    auction_cache["timestamp"] = current_time
    return all_auctions

async def get_item_prices(item_name):
    result = {
        'auction_house': [],
        'bazaar': {
            'sell_orders': [],
            'buy_orders': []
        }
    }
    
    all_auctions = await get_all_auctions()
    item_auctions = [a for a in all_auctions if item_name.lower() in a.get('item_name', '').lower() and a.get('bin', False)]
    bin_prices = sorted([a['starting_bid'] for a in item_auctions])
    result['auction_house'] = [format_number(price) for price in bin_prices[:5]]
    
    async with aiohttp.ClientSession() as session:
        bazaar_url = 'https://api.hypixel.net/skyblock/bazaar'
        async with session.get(bazaar_url) as response:
            if response.status == 200:
                bazaar_data = await response.json()
                products = bazaar_data.get('products', {})
                bazaar_item_name = item_name.upper().replace(' ', '_')
                item_data = products.get(bazaar_item_name) or products.get(item_name) or {}
                
                sell_orders = item_data.get('sell_summary', [])
                buy_orders = item_data.get('buy_summary', [])
                
                result['bazaar']['sell_orders'] = [format_number(order['pricePerUnit']) for order in sell_orders[:5]]
                result['bazaar']['buy_orders'] = [format_number(order['pricePerUnit']) for order in buy_orders[:5]]
    
    return result

