def is_admin(member_or_id):
    if isinstance(member_or_id, discord.Member):
        return member_or_id.guild_permissions.administrator
    elif isinstance(member_or_id, int):
        async def check_admin(interaction: discord.Interaction):
            member = await interaction.guild.fetch_member(member_or_id)
            return member.guild_permissions.administrator
        return check_admin
    return False

def is_whitelisted(member_or_id):
    if isinstance(member_or_id, discord.Member):
        return member_or_id.id in whitelist or is_admin(member_or_id)
    elif isinstance(member_or_id, int):
        return member_or_id in whitelist or is_admin(member_or_id)
    return False

