def stronger_chars_for_regex():
    base_map = chars_for_regex()
    substitutions = {
        'i': base_map['i'] + r'|1|!|\\|',
        'l': base_map['l'] + r'|1|!|\\|',
        'e': base_map['e'] + r'|3',
        'a': base_map['a'] + r'|@|4',
        's': base_map['s'] + r'|5|\$',
        'o': base_map['o'] + r'|0',
        'g': base_map['g'] + r'|9|6',
        't': base_map['t'] + r'|7',
        'b': base_map['b'] + r'|8',
        'n': base_map['n'] + r'|ո',
        'x': base_map['x'] + r'|×',
    }
    return {**base_map, **substitutions}

def generate_regex_pattern(word):
    word = normalize_text(word)
    pattern = r'(?i)(?:\b|(?<=\W)|^)(?:[^\w]*?)'
    
    char_map = chars_for_regex()
    pattern += f'(?=(?:.*?[^\w]*?){{{len(word)-1}}})'
    
    for i, char in enumerate(word):
        if char in char_map:
            char_pattern = char_map[char]
        else:
            char_pattern = re.escape(char)
        if i > 0:
            pattern += r'(?:[^\w]*?[^\s\w]?[^\w]*?)?'
        pattern += f'(?:{char_pattern})'
    
    pattern += r'(?:[^\w]*?)(?:\b|(?=\W)|$)'
    
    return pattern

def generate_stronger_regex_pattern(word):
    word = normalize_text(word)
    pattern = r'(?i)(?:\b|(?<=\W)|^)(?:[^\w]*?)'
    
    char_map = stronger_chars_for_regex()
    pattern += f'(?=(?:.*?[^\w]*?){{{len(word)-1}}})'
    
    for i, char in enumerate(word):
        if char in char_map:
            char_pattern = char_map[char]
        else:
            char_pattern = re.escape(char)
        if i > 0:
            pattern += r'(?:[^\w]*?[^\s\w]?[^\w]*?)?'
        pattern += f'(?:{char_pattern})'
    
    pattern += r'(?:[^\w]*?)(?:\b|(?=\W)|$)'
    
    return pattern

