def update_chat_context(new_message):
    global chat_history, CHAT_CONTEXT_LIMIT
    chat_history.append(new_message)
    while len(tokenizer.encode("\n".join(chat_history))) > CHAT_CONTEXT_LIMIT:
        chat_history.pop(0)
    return chat_history

def update_prompt_context(user_prompt):
    global prompt_history, PROMPT_CONTEXT_LIMIT
    prompt_history.append(user_prompt)
    while len(tokenizer.encode("\n".join(prompt_history))) > PROMPT_CONTEXT_LIMIT:
        prompt_history.pop(0)
    return prompt_history

async def generate_response_groq(user_message, temperature=0.7, top_p=0.9, model="llama-3.1-70b-versatile"):
    messages = [
        {"role": "system", "content": bot.system_prompt},
        {"role": "user", "content": user_message}
    ]
    
    try:
        loop = asyncio.get_running_loop()
        response = await loop.run_in_executor(None, partial(
            client.chat.completions.create,
            model=model,
            messages=messages,
            max_tokens=512,
            temperature=temperature,
            top_p=top_p,
            stop=["//done//", "User:", "Human:"]
        ))
        return response.choices[0].message.content.strip()
    except Exception as e:
        print(f"Error generating response: {e}")
        return "Sorry, I encountered an error while processing your request."

async def generate_response_gemini(user_message, temperature=0.6, top_p=0.7, model="gemini-1.5-flash", google_ai_key=""): # put in google api key here
    try:
        genai.configure(api_key=google_ai_key)
        model = genai.GenerativeModel(model_name=model)
        generation_config = GenerationConfig(
            temperature=temperature,
            top_p=top_p,
            max_output_tokens=256,
            stop_sequences=["//done//", "User:", "Human:"]
        )
        loop = asyncio.get_running_loop()
        response = await loop.run_in_executor(
            None,
            lambda: model.generate_content(
                user_message,
                generation_config=generation_config
            )
        )
        return response.text.strip()

    except Exception as e:
        print(f"Error generating response: {e}")
        return f"Sorry, I encountered an error while processing your request: {str(e)}"

async def generate_response(user_message, temperature=0.7, top_p=0.9, model="llama-3.1-70b-versatile", backend='groq'):
    print("generate_response triggered")
    print(user_message)
    if backend == 'groq':
        response = await generate_response_groq(user_message, temperature, top_p, "llama-3.1-70b-versatile")
    elif backend == 'gemini':
        response = await generate_response_gemini(user_message, temperature, top_p, "gemini-1.5-flash", "") # put in google api key here
    else:
        return "Invalid backend specified. Please choose 'groq' or 'gemini'."
    return response

def auto_mod(message):
    normalized_message = normalize_text(message)
    for pattern in BAD_WORDS_PATTERNS:
        if pattern.search(normalized_message):
            return True
    return False

def censor_message(message):
    normalized_message = normalize_text(message)
    for pattern in BAD_WORDS_PATTERNS:
        normalized_message = pattern.sub('[CENSORED]', normalized_message)
    return normalized_message

def strong_censor_message(message):
    normalized_message = normalize_text(message)
    for pattern in REALLY_STRONG_BAD_WORDS_PATTERNS:
        normalized_message = pattern.sub('[CENSORED]', normalized_message)
    return normalized_message

def remove_attachments_and_links(message):
    import re
    return re.sub(r'http\S+', '', message)

def remove_discord_invites(message):
    import re
    patterns = [
        r'discord\.gg/\S+',
        r'discord\.com/invite/\S+',
        r'discordapp\.com/invite/\S+'
    ]
    for pattern in patterns:
        message = re.sub(pattern, '', message)
    return message

