@bot.tree.command(name='addautomodword', description='Add a single word to the bad words list.')
@whitelist_only()
async def add_word(interaction: discord.Interaction, word: str):
    try:
        result = collection.update_one(
            {"_id": "bad_words_list"},
            {"$addToSet": {"words": word}}
        )
        if result.modified_count > 0:
            await interaction.response.send_message(f"Successfully added '{word}' to the bad words list.")
        else:
            await interaction.response.send_message(f"'{word}' is already in the bad words list.")
    except Exception as e:
        await interaction.response.send_message(f"An error occurred: {str(e)}")

