@bot.tree.command(name="trivia", description="Generate a trivia question")
async def trivia(interaction: discord.Interaction):

    prompt = f"Generate a trivia question about Hypixel SkyBlock using the following information:\n\n{SKYBLOCK_INFO}\n\nProvide the answer first, then the question. Here's an example: Answer: Fahn\nQuestion: Which NPC in the Hypixel SkyBlock hub allows players to upgrade their Pets using Coins?\nThis is an example, do not use this question, be diverse in your possible questions asking anything from questions about NPCs to questions about weapon progression, questions about fishing armor progression, questions about mining armor progression, anything in the game info provided that is unrelated to prices/cost of anything or anything that can be subjective (eg. how much damage a midgame player does)."
    response = await generate_response(prompt, temperature=0.2, top_p=0.9, model="gemini-1.5-flash", backend='gemini')
    
    parts = response.split('\n', 1)
    if len(parts) == 2:
        answer, question = parts
        answer = answer.strip().replace("Answer: ", "")
        trivia_answers[interaction.channel.id] = answer
        await interaction.response.send_message(f"Trivia Question: {question.strip()}")
        timeout_task = asyncio.create_task(handle_timeout(interaction, answer))
        try:
            await timeout_task
        except asyncio.CancelledError:
            pass
    else:
        await interaction.response.send_message("Sorry, I couldn't generate a proper trivia question. Please try again.")

async def handle_timeout(interaction: discord.Interaction, answer: str):
    await asyncio.sleep(30.0)
    await interaction.followup.send(f"Time's up! The correct answer was: {answer}")
    trivia_answers.pop(interaction.channel.id, None)

