@bot.tree.command(name="copycat", description="Mimic a user's style")
@whitelist_only()
async def copycat(interaction: discord.Interaction, user: discord.Member, message_count: int = 100):
    if not user:
        await interaction.response.send_message("User not found.")
        return

    message_count = max(25, min(400, message_count))
    await interaction.response.defer()

    try:
        messages = []
        channel = interaction.channel
        if channel.permissions_for(interaction.guild.me).read_message_history:
            async for msg in channel.history(limit=1000, oldest_first=False):
                if msg.author == user and msg.content:
                    messages.append(f"{user.name}: {msg.content}")
                    if len(messages) >= message_count:
                        break
                await asyncio.sleep(0.05)

        if not messages:
            await interaction.followup.send(f"No recent messages found for {user.name} in this channel.")
            return

        combined_messages = '\n'.join(messages)
        truncated_messages = tokenizer.decode(tokenizer.encode(combined_messages)[:CHAT_CONTEXT_LIMIT])
        bot.system_prompt = f"{SYSTEM_PROMPT} Additionally, mimic the following style:\n{truncated_messages}"
        global chat_history
        chat_history = messages
        await interaction.followup.send(f"Now mimicking **{user.name}**'s style based on their last {len(messages)} messages.")
    except Exception as e:
        await interaction.followup.send(f"Error fetching messages: {e}")

@bot.tree.command(name="start_guessing_game", description="Start a guessing game")
async def start_guessing_game(interaction: discord.Interaction):
    global guessing_game_active, guessing_game_user, chat_history
    if guessing_game_active:
        await interaction.response.send_message("A guessing game is already in progress.")
        return

    await interaction.response.defer()

    try:
        channel = interaction.channel
        guild_members = interaction.guild.members
        non_bot_members = [member for member in guild_members if not member.bot]

        valid_users = []
        message_count = {}
        fifteen_minutes_ago = datetime.now(timezone.utc) - timedelta(minutes=15)

        if channel.permissions_for(interaction.guild.me).read_message_history:
            async for message in channel.history(limit=1000, oldest_first=False, after=fifteen_minutes_ago):
                author = message.author
                if not author.bot:
                    message_count[author] = message_count.get(author, 0) + 1
                    if author not in valid_users:
                        valid_users.append(author)
                        if len(valid_users) >= 5:
                            break

        if not valid_users:
            await interaction.followup.send("Couldn't find any users who have spoken in the last 15 minutes. Try again later.")
            return

        guessing_game_user = random.choice(valid_users)
        guessing_game_active = True

        messages = []
        async for msg in channel.history(limit=1000, oldest_first=False):
            if msg.author == guessing_game_user and msg.content:
                messages.append(f"{guessing_game_user.name}: {msg.content}")
                if len(messages) >= 500:
                    break

        combined_messages = '\n'.join(messages)
        truncated_messages = tokenizer.decode(tokenizer.encode(combined_messages)[:CHAT_CONTEXT_LIMIT])
        bot.system_prompt = f"{SYSTEM_PROMPT} Additionally, mimic the following style without revealing the person's name:\n{truncated_messages}"
        
        chat_history = messages
        print(chat_history)

        await interaction.followup.send("Guessing game started! Guess who I am with the /guess command!")
    except Exception as e:
        guessing_game_active = False
        guessing_game_user = None
        await interaction.followup.send(f"Error starting the game: {e}")

